(function () {
  var sprites = {
    megaman : {"modelVersion":2,"piskel":{"name":"Megaman moving","description":"","fps":2,"height":28,"width":31,"layers":["{\"name\":\"Layer 1\",\"frameCount\":3,\"base64PNG\":\"data:image/png;base64,\"}"]}},
    sonic : {"modelVersion":2,"piskel":{"name":"Imported piskel","description":"","fps":12,"height":50,"width":50,"layers":["{\"name\":\"Layer 1\",\"frameCount\":25,\"base64PNG\":\"data:image/png;base64,\"}"]}},
    mario : {"modelVersion":2,"piskel":{"name":"Mario kart","description":"","fps":3,"height":42,"width":40,"layers":["{\"name\":\"Layer 1\",\"frameCount\":2,\"base64PNG\":\"data:image/png;base64,\"}"]}}

  };

  var init = function () {
    var sidebarEl = document.querySelector(".sidebar");
    sidebarEl.addEventListener("click", function (evt) {
      var spriteName = evt.target.dataset.sprite;
      if (spriteName && sprites[spriteName]) {
        loadSprite(sprites[spriteName]);
      }
    });
  };

  var loadSprite = function (sprite) {
    var editorFrameEl = document.querySelector(".editor-frame");
    var pskl = editorFrameEl.contentWindow.pskl;
    if (pskl) {
      var fps = sprite.piskel.fps;
      var piskel = sprite.piskel;
      var descriptor = new pskl.model.piskel.Descriptor(piskel.name, piskel.description, true);
      pskl.utils.serialization.Deserializer.deserialize(sprite, function (piskel) {
        piskel.setDescriptor(descriptor);
        pskl.app.piskelController.setPiskel(piskel);
        pskl.app.previewController.setFPS(fps);
      });
    }

  };

  init();
})();